from org.apache.commons.io import IOUtils
from java.nio.charset import StandardCharsets
from org.apache.nifi.processor.io import StreamCallback
import json
import datetime

class ModJSON(StreamCallback):
    def __init__(self):
        self.filtered_data = []
        self.new_fichier_patient = []

    def v_length100(self, objet_json, tab_field_test):
        for data in objet_json["FichierPatient"]:
            for field in tab_field_test:
                try:
                    if len(data[field]) > 100:
                        self.filtered_data.append({
                            "PATIENTNUMBER": data["PATIENTNUMBER"],
                            field: data[field],
                            "RULES": "V-Length100",
                            "ACTION": "Avertissement",
                            "MESSAGE": "La longueur ne doit pas depasser 100 caracteres"
                        })
                except KeyError:
                    pass

    def v_alpha_2(self, objet_json, tab_field_test):
        for data in objet_json["FichierPatient"]:
            for field in tab_field_test:
                try:
                    if not data[field].isalpha():
                        self.filtered_data.append({
                            "PATIENTNUMBER": data["PATIENTNUMBER"],
                            field: data[field],
                            "RULES": "V-Alpha-2",
                            "ACTION": "Avertissement",
                            "MESSAGE": "Alpha characters only"
                        })
                except KeyError:
                    pass

    def v_not_null_1(self, objet_json, tab_field_test):
        for data in objet_json["FichierPatient"]:
            for field in tab_field_test:
                try:
                    if data[field] is None or data[field] == "":
                        self.filtered_data.append({
                            "PATIENTNUMBER": data["PATIENTNUMBER"],
                            field: data[field],
                            "RULES": "V-NotNull-1",
                            "ACTION": "Rejet",
                            "MESSAGE": "Valeur ne peut pas Etre null ou vide"
                        })
                    else:
                        self.new_fichier_patient.append(data)
                except KeyError:
                    pass

    def d_date_creation(self, objet_json):
        last_updated_datetime = datetime.datetime.now().strftime("%Y-%m-%d %H:%M:%S")
        if not objet_json["FichierPatient"]:
            objet_json["FichierPatient"].append({"FILEDATECREATION": last_updated_datetime})
        else:
            for data in objet_json["FichierPatient"]:
                data["EXTRA_LASTUPDATEDATETIME"] = last_updated_datetime

    def process(self, inputStream, outputStream):
        text = IOUtils.toString(inputStream, StandardCharsets.UTF_8)
        obj = json.loads(text)
        self.v_length100(obj, ["EXTRA_FATHERSFIRSTNAME", "EXTRA_FATHERSLASTNAME"])
        self.v_alpha_2(obj, ["EXTRA_FATHERSFIRSTNAME", "EXTRA_FATHERSLASTNAME", "TITLE"])
        self.v_not_null_1(obj, ["EXTRA_DATEOFDEATH"])
        obj["RapportConformite"] = self.filtered_data
        obj["FichierPatient"] = self.new_fichier_patient
        self.d_date_creation(obj)
        outputStream.write(bytearray(json.dumps(obj, ensure_ascii=False).encode('utf-8')))

flowFile = session.get()
if flowFile is not None:
    flowFile = session.write(flowFile, ModJSON())
session.transfer(flowFile, REL_SUCCESS)
